import React from 'react';
import { BrowserRouter as Router, Link, Routes, Route } from 'react-router-dom';
import ListFiles from './pages/ListFiles';
import UploadFile from './pages/UploadFile';
import DeleteFiles from './pages/DeleteFiles';

function App() {
  return (
    <Router>
      <nav>
        <Link to="/">List Files</Link> | <Link to="/upload">Upload File</Link> | <Link to="/delete">Delete Files</Link>
      </nav>
      <Routes>
        <Route path="/" element={<ListFiles />} />
        <Route path="/upload" element={<UploadFile />} />
        <Route path="/delete" element={<DeleteFiles />} />
      </Routes>
    </Router>
  );
}
export default App;
